    from tbl_jenis_kain tjk
    left join tbl_hasilcelup th on th.proses_point like CONCAT('%', tjk.jenis_kain, '%')
    left join tbl_montemp tm on tm.id = th.id_montemp
    left join tbl_schedule ts on tm.id_schedule = ts.id
